import { v4 as uuidv4 } from 'uuid';

export const dropDownList = [
    {
        id: uuidv4(),
        name: 'Road'
    },
    {
        id: uuidv4(),
        name: 'Mountain'
    },
    {
        id: uuidv4(),
        name: 'Sport'
    },
    {
        id: uuidv4(),
        name: 'BMX'
    },
];
